    // Time - O(nm)
    func findSubsrtingNaive(string: String, pattern: String) {
        let stringLength = string.count
        let patternLength = pattern.count
        for i in 0..<stringLength - patternLength - 1 {
            var counter: Int = 0
            while counter < patternLength {
                if string[i + counter] != pattern[counter] {
                    break
                }
                counter += 1
            }
            if counter == patternLength {
                print("Found at index - \(i)")
            }
        }
    }

    // O(n)
    func reverseStringTwoPointers(string: inout String) {
        var left = 0, right = string.count - 1
        while left < right {
            var temp = string[left]
            string[left] = string[right]
            string[right] = temp
            left += 1
            right -= 1
        }
    }

    // O(n)
    func checkIsPalindrome(string: String) -> Bool {
        var left = 0, right = string.count - 1
        while left < right {
            guard string[left] == string[right] else { return false }

            left += 1
            right -= 1

        }
        return true
    }

    func checkIsPalindrome(string: String, left: Int, right: Int) -> Bool {
        var left = left
        var right = right
        while left < right {
            guard string[left] == string[right] else { return false }

            left += 1
            right -= 1

        }
        return true
    }

