    /*
     Given a non-empty string s and a dictionary wordDict containing a list of non-empty words,
     determine if s can be segmented into a space-separated sequence of one or more dictionary words.

     Note:

     The same word in the dictionary may be reused multiple times in the segmentation.
     You may assume the dictionary does not contain duplicate words.
     Example 1:

     Input: s = "leetcode", wordDict = ["leet", "code"]
     Output: true
     Explanation: Return true because "leetcode" can be segmented as "leet code".
     Example 2:

     Input: s = "applepenapple", wordDict = ["apple", "pen"]
     Output: true
     Explanation: Return true because "applepenapple" can be segmented as "apple pen apple".
                  Note that you are allowed to reuse a dictionary word.
     Example 3:

     Input: s = "catsandog", wordDict = ["cats", "dog", "sand", "and", "cat"]
     Output: false
     */

    /**
    Big O Annotation
    Time complexity O(n) where n is the amount of elements in nums.
    Space complexity O(n) where n is the amount of elements in nums.
    */
    // This is not a correct solution
    func wordBreak(string: String, wordDictionary: [String]) -> Bool {

        var string = string

        for element in wordDictionary {
            let replaced = string.replacingOccurrences(of: element, with: "")
            if replaced == string {
                return false
            }
            string = replaced
        }

        return string.isEmpty
    }
    
    func wordBreak(s: String, wordDict: [String]) -> Bool {
        let wordSet = Set(wordDict)
        let n = s.count
        var dp = Array(repeating: false, count: n + 1)
        dp[0] = true
        
        let chars = Array(s)
        
        for i in 1...n {
            for j in 0..<i {
                let substring = String(chars[j..<i])
                if dp[j] && wordSet.contains(substring) {
                    dp[i] = true
                    break
                }
            }
        }
        
        return dp[n]
    }
    /*
     Longest substring without repeating characters
     Example 1:

     Input: "abcabcbb"
     Output: 3
     Explanation: The answer is "abc", with the length of 3.
     Example 2:

     Input: "bbbbb"
     Output: 1
     Explanation: The answer is "b", with the length of 1.
     Example 3:

     Input: "pwwkew"
     Output: 3
     Explanation: The answer is "wke", with the length of 3.
                  Note that the answer must be a substring, "pwke" is a subsequence and not a substring.
     */
    // Converting String to char array and vice versa works faster in leet code than using String.Index
    func longestSubstring(string: String) -> Int {
        if string.count < 2 {
            return string.count
        }
        var charSet = Set<Character>()
        var charArray = Array(string)
        var leftIndex = 0
        var rightIndex = 0
        var maximum = 0
        while rightIndex < string.count {
            let leftString = charArray[leftIndex]
            let rightString = charArray[rightIndex]
            if charSet.contains(rightString) {
                charSet.remove(leftString)
                leftIndex += 1
            } else {
                charSet.insert(rightString)
                rightIndex += 1
                maximum = max(maximum, charSet.count)
            }

        }
        return charSet.count
    }

