            left += 1
            right -= 1
        }*/

    }

    // For a given string find all the possible palindrome substrings
    // For a given string s, partition it in such a way that every substring of the partition is a palindrome. Return all possible palindrome partioning of s
    // Ex
    // Input - "aab"
    // Output - [["a", "a", b"], ["aa", "b"]]

    func partitionPalindrome(string: String) -> [[String]] {
        var result = [[String]]()
        partitionPalindromeRecursion(result: &result, string: string, index: 0, current: [])
        return result
    }
    func partitionPalindromeRecursion(result: inout [[String]], string: String, index: Int, current: [String]) {
        if index == string.count {
            result.append(current)
            return
        }
        var current = current
        for i in index..<string.count {
            let firstSubstring = String(Array(string)[index...i])

            if checkIsPalindrome(string: firstSubstring) {
                current.append(firstSubstring)
                partitionPalindromeRecursion(result: &result, string: string, index: i + 1, current: current)
                current.remove(at: current.count - 1)
            }
        }
    }
